Insert into GZONE.REVIEWBOARD (REVIEW_IDX,MEMBER_IDX,COURSE_IDX,REVIEW_TITLE,REVIEW_CONTENT,REVIEW_CRE_DATE,REVIEW_MOD_DATE,REVIEW_READ_COUNT,REVIEW_LIKE_COUNT,REVIEW_RATING) values (1,1,1,'혜화마을로 놀러오세요','아름다운 자연과 하나되는 혜화성곽마을로 놀러오세요~~',to_date('20/07/15','RR/MM/DD'),to_date('20/07/17','RR/MM/DD'),14,0,5);
Insert into GZONE.REVIEWBOARD (REVIEW_IDX,MEMBER_IDX,COURSE_IDX,REVIEW_TITLE,REVIEW_CONTENT,REVIEW_CRE_DATE,REVIEW_MOD_DATE,REVIEW_READ_COUNT,REVIEW_LIKE_COUNT,REVIEW_RATING) values (2,3,1,'밤의 그윽한 향기','안녕하세요 ?<br/><br/>2020년 5월 5일 혜화명륜성곽마을 추천 코스를 이용해봤습니다.<br/><br/>서울에 이런 광경이 존재한다는 게 참 울컥하더군요.. 여자친구가 생기면 같이 와보고 싶습니다. 제 주변에는 하나 둘 서로의 짝을 찾은 연인들만이 연인들만을 위한 세상을 위해 애쓰고 있더군요.. <br/><br/>혜화명륜성곽마을, 참 좋습니다. 인연을 만나기 참 좋은 곳 같기도 합니다. 웃으면서 말 걸어주신는 좋은 마을 주민 분들이 기억에 남습니다.',to_date('20/07/16','RR/MM/DD'),to_date('20/07/17','RR/MM/DD'),26,0,5);
Insert into GZONE.REVIEWBOARD (REVIEW_IDX,MEMBER_IDX,COURSE_IDX,REVIEW_TITLE,REVIEW_CONTENT,REVIEW_CRE_DATE,REVIEW_MOD_DATE,REVIEW_READ_COUNT,REVIEW_LIKE_COUNT,REVIEW_RATING) values (3,5,1,'봄꽃이 만발했던 혜화마을','이번 봄에 시험과 겹쳐서 멀리 가지 못하고 공부하고 있었는데<br/>혜화마을이 근처여서 잠깐 산책 겸 기분전환으로 들렸습니다.<br/>멀리 가지 않고도 이렇게 예쁜 벚꽃을 볼 수 있다니~<br/>정말 잘 쉬고 갑니다. <br/>다음에는 공부걱정도 없이 놀러오고 싶어요~!!',to_date('20/07/17','RR/MM/DD'),to_date('20/07/17','RR/MM/DD'),10,0,4);
Insert into GZONE.REVIEWBOARD (REVIEW_IDX,MEMBER_IDX,COURSE_IDX,REVIEW_TITLE,REVIEW_CONTENT,REVIEW_CRE_DATE,REVIEW_MOD_DATE,REVIEW_READ_COUNT,REVIEW_LIKE_COUNT,REVIEW_RATING) values (4,4,1,'햇볕 쨍한 날','마을 전체에 햇볕이 잘들어서 좋은데 <br/>너무 더운날 찾아가서 걷기 힘들었습니다. <br/>그래도 가보기 좋은 마을이라고 생각합니다.<br/>날씨가 좋을 때 다시 찾아오려고요~',to_date('20/07/17','RR/MM/DD'),to_date('20/07/17','RR/MM/DD'),5,0,3);
Insert into GZONE.REVIEWBOARD (REVIEW_IDX,MEMBER_IDX,COURSE_IDX,REVIEW_TITLE,REVIEW_CONTENT,REVIEW_CRE_DATE,REVIEW_MOD_DATE,REVIEW_READ_COUNT,REVIEW_LIKE_COUNT,REVIEW_RATING) values (5,2,1,'쉴 곳이 없어요','마을은 좋은데 걸어다니면서 중간중간 쉴 공간이 없네요<br/>의자를 더 설치해주셨으면 좋겠습니다. ',to_date('20/07/17','RR/MM/DD'),to_date('20/07/17','RR/MM/DD'),6,0,1);
Insert into GZONE.REVIEWBOARD (REVIEW_IDX,MEMBER_IDX,COURSE_IDX,REVIEW_TITLE,REVIEW_CONTENT,REVIEW_CRE_DATE,REVIEW_MOD_DATE,REVIEW_READ_COUNT,REVIEW_LIKE_COUNT,REVIEW_RATING) values (6,6,1,'제건화로 정말 맛집이네요','후기 보고 찾아가봤는데<br/>정말 맛집이네요<br/>이 날 친구들 3명이서 삼겹살 6인분에 반주해서 먹었습니다.  <br/>고기 먹고 볶음밥도 꼭 시켜드세요<br/>김치치즈볶음밥인데 옥수수와 날치알도 들어서 톡톡 터지고 정말 맛있습니다.',to_date('20/07/17','RR/MM/DD'),to_date('20/07/17','RR/MM/DD'),9,0,5);
Insert into GZONE.REVIEWBOARD (REVIEW_IDX,MEMBER_IDX,COURSE_IDX,REVIEW_TITLE,REVIEW_CONTENT,REVIEW_CRE_DATE,REVIEW_MOD_DATE,REVIEW_READ_COUNT,REVIEW_LIKE_COUNT,REVIEW_RATING) values (7,9,1,'혜화마을에 놀러왔습니다^^','초롱이 예뻐서 사진 한장 찍어봤습니다 ^^<br/>다음에도 꼭 놀러오고 싶을 정도로 다들 친절하고<br/>좋은 마을이였어요 꼭 놀러오세요~',to_date('20/07/17','RR/MM/DD'),to_date('20/07/17','RR/MM/DD'),3,0,4);
Insert into GZONE.REVIEWBOARD (REVIEW_IDX,MEMBER_IDX,COURSE_IDX,REVIEW_TITLE,REVIEW_CONTENT,REVIEW_CRE_DATE,REVIEW_MOD_DATE,REVIEW_READ_COUNT,REVIEW_LIKE_COUNT,REVIEW_RATING) values (8,12,1,'비가 와서 많이 못 돌아다녔지만 다녀올만 합니다. ','비가 너무 많이 와서 구경을 못했어요 ㅠㅠ<br/>그래서 스타벅스에서 친구들과 디저트 먹고 왔습니다. <br/>저희는 못 돌아다녔지만 비오는 날 마을 분위기는 좋았어요',to_date('20/07/17','RR/MM/DD'),to_date('20/07/17','RR/MM/DD'),5,0,3);
Insert into GZONE.REVIEWBOARD (REVIEW_IDX,MEMBER_IDX,COURSE_IDX,REVIEW_TITLE,REVIEW_CONTENT,REVIEW_CRE_DATE,REVIEW_MOD_DATE,REVIEW_READ_COUNT,REVIEW_LIKE_COUNT,REVIEW_RATING) values (9,18,1,'서울에 이런 곳이 있었다니','정말 좋네요<br/><br/>친구들이랑 오전에 근처 가게 들어가서 <br/>점심 김치치즈피자탕수육 사먹고 <br/>돌아다녔는데 멀리 놀러나온 기분입니다. <br/> <br/>가을에 단풍 물들때 와도 정말 멋질 것 같습니다  :)',to_date('20/07/17','RR/MM/DD'),to_date('20/07/17','RR/MM/DD'),17,0,5);
Insert into GZONE.REVIEWBOARD (REVIEW_IDX,MEMBER_IDX,COURSE_IDX,REVIEW_TITLE,REVIEW_CONTENT,REVIEW_CRE_DATE,REVIEW_MOD_DATE,REVIEW_READ_COUNT,REVIEW_LIKE_COUNT,REVIEW_RATING) values (10,3,1,'다시 찾아왔습니다','저번에 야경이 너무 좋았던 기억이 남아<br/>다시 찾아왔습니다.<br/>낮에 와도 돌담길 구경하고 볼 것이 많네요<br/><br/>저번에 댓글로 제건화로 추천했었는데 <br/>반응이 너무 좋아서 다른 맛집 추천합니다.<br/>혹시 이 근처로 오게 된다면<br/>용훈떡볶이집의 파채떡볶이 들려보세요<br/>정말 맛있습니다.  ',to_date('20/07/17','RR/MM/DD'),to_date('20/07/17','RR/MM/DD'),2,0,5);
