Insert into GZONE.REVIEWBOARD (REVIEW_IDX,MEMBER_IDX,COURSE_IDX,REVIEW_TITLE,REVIEW_CONTENT,REVIEW_CRE_DATE,REVIEW_MOD_DATE,REVIEW_READ_COUNT,REVIEW_LIKE_COUNT,REVIEW_RATING) values (519,27,1,'종소리가 아름다운 혜화마을','바람을 타고 부는 종소리가 아름다운 마을입니다.<br/>푹 쉬고 가기 좋은 산책길이네요~',to_date('20/07/21','RR/MM/DD'),to_date('20/07/21','RR/MM/DD'),5,0,5);
Insert into GZONE.REVIEWBOARD (REVIEW_IDX,MEMBER_IDX,COURSE_IDX,REVIEW_TITLE,REVIEW_CONTENT,REVIEW_CRE_DATE,REVIEW_MOD_DATE,REVIEW_READ_COUNT,REVIEW_LIKE_COUNT,REVIEW_RATING) values (520,2,1,'오늘 명륜 마을에서 야채 비빔밥을 먹고왔습니다!','혜화 명륜 마을에서 유명하다고 소문이 자자한 식당에 가서<br/>야채 비빔밥을 시켜먹어요 ㅎㅎ<br/><br/>맛집이라고 소문이 자자 해서 기대했는데 정말로 맛있더라고요!<br/><br/>진짜 추천드립니다. ㅎㅎㅎ<br/><br/>또 다 먹고 요구르트까지 서비스!<br/><br/>다음에 또 가보고 싶어요!<br/><br/>다른분들도 한번쯤 시간 되시면 가보세요! 강추입니다!!',to_date('20/07/21','RR/MM/DD'),to_date('20/07/21','RR/MM/DD'),16,0,5);
Insert into GZONE.REVIEWBOARD (REVIEW_IDX,MEMBER_IDX,COURSE_IDX,REVIEW_TITLE,REVIEW_CONTENT,REVIEW_CRE_DATE,REVIEW_MOD_DATE,REVIEW_READ_COUNT,REVIEW_LIKE_COUNT,REVIEW_RATING) values (521,4,1,'마을 어귀에 한옥카페가 있는데 ','분위기가 좋습니다. <br/>아메리카노랑 당근케이크 먹었는데<br/>가격도 저렴하고 맛있습니다. <br/>다른 관광지와 다르게 비싸지 않다는 점이 마음에 드네요<br/>안에 들어가서 <br/>창가 자리에 앉으시면<br/>풍경이 울리는 소리를 들으면서<br/>커피를 마실 수 있습니다 :)',to_date('20/07/21','RR/MM/DD'),to_date('20/07/21','RR/MM/DD'),4,0,4);
Insert into GZONE.REVIEWBOARD (REVIEW_IDX,MEMBER_IDX,COURSE_IDX,REVIEW_TITLE,REVIEW_CONTENT,REVIEW_CRE_DATE,REVIEW_MOD_DATE,REVIEW_READ_COUNT,REVIEW_LIKE_COUNT,REVIEW_RATING) values (522,19,1,'앉아서 맥주 한잔','힘들지만 올라가면<br/>커다란 나무가 한 그루 있는데 <br/>거기서 가져온 맥주 한 잔 마시면<br/>그렇게 맛있을 수가 없어요 크으~~<br/>(물론 다 먹은 캔도 잘 챙겨서 내려왔습니다.)<br/>',to_date('20/07/21','RR/MM/DD'),to_date('20/07/21','RR/MM/DD'),3,0,5);
Insert into GZONE.REVIEWBOARD (REVIEW_IDX,MEMBER_IDX,COURSE_IDX,REVIEW_TITLE,REVIEW_CONTENT,REVIEW_CRE_DATE,REVIEW_MOD_DATE,REVIEW_READ_COUNT,REVIEW_LIKE_COUNT,REVIEW_RATING) values (523,26,1,'추천 받고 한번 갔다 와봤습니다.','계단이 정말 이쁘더군요. 무더운 날씨였지만<br/>아름다운 풍경들을 보니 더위도 싹 잊게 되더라구요. ㅎㅎ<br/><br/>여러분들도 한번 갔다 와보세요.~',to_date('20/07/21','RR/MM/DD'),to_date('20/07/21','RR/MM/DD'),5,0,4);
